import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Avatar, Typography, Fab, Icon } from '@material-ui/core';

import { Parallax } from 'react-parallax';

const useStyles = makeStyles({
    skyliner: {
        width: '100%',
        height: '40vh',
    },
    skylinerRow: {
        height: '40vh',
        display: 'flex',
        alignItems: 'flex-end',
    },
    skylinerContent: {
        display: 'flex',
        alignItems: 'flex-end',
        flexDirection: 'row',
        flexWrap: 'none',
    },
    profileAvatar: {
        width: 120,
        height: 120,
    },
    username: {
        color: 'white',
    },
    skylinerDivLeft: {
        display: 'flex',
        alignItems: 'flex-end',
    },
    skylinerDivRight: {
        width: '100%',
        display: 'flex',
        justifyContent: 'flex-end'
    },
    Fab: {
        margin: '0px 20px',
    },
})

function Skyliner(props) {

    const classes = useStyles();

    return (
        <Fragment>
            <Parallax
                bgImage={require('./imgs/nasa.jpg')}
                bgImageAlt="Skyliner"
                strength={200}
                className={classes.skyliner}
            >
                <div className={`row ${classes.skylinerRow}`}>
                    <div className={`col-6 ${classes.skylinerContent}`}>
                        <div className={classes.skylinerDivLeft}>
                            <Avatar src='/imgs/avatar.jpg' className={classes.profileAvatar} />
                            <Typography
                                display="inline"
                                variant="h2"
                                color="textPrimary"
                                className={classes.username}
                            >
                                {props.user}
                            </Typography>
                        </div>
                    </div>
                    <div className={`col-6 ${classes.skylinerContent}`}>
                        <div className={classes.skylinerDivRight}>
                            <Fab className={classes.Fab}>
                                <Icon>person_add</Icon>
                            </Fab>
                            <Fab className={classes.Fab}>
                                <Icon>message</Icon>
                            </Fab>
                        </div>
                    </div>
                </div>
            </Parallax>
        </Fragment>
    );
}


export default Skyliner;
